import React, { Component } from 'react';
import './App.css';
import NavBar from './component/NavBar/NavBar';
import PropertyList from './component/Property/PropertyList/PropertyList';

const initialState = {
        isSignedIn: false,
        properties: [
                {
                        id: 1,
                        location: 'Canada',
                        title: 'Hotel',
                        type: 'Hotel',
                        price: 100,
                        rating: 3.4
                },

                {
                        id: 2,
                        location: 'Canada',
                        title: 'House',
                        type: 'House',
                        price: 102,
                        rating: 4.0
                },

                {
                        id: 3,
                        location: 'Canada',
                        title: 'Apartment',
                        type: 'Apartment',
                        price: 101,
                        rating: 4.0
                }

        ]

}

class App extends Component {

        constructor() {
                super();
                this.state = initialState;
        }

        render() {
                return (
                        <div>
                                <NavBar />
                                <PropertyList properties={this.state.properties} />
                        </div>
                );
        }
}

export default App;
